import logo from './logo.svg';
import landing from './landing.svg';
import './App.css';
import React from "react";

function App() {
  return (
    <div className="App">
        <div className="App-main">
        <img src={logo} className="App-logo" alt="Company logo"/>
        </div>
    </div>

  );
}

export default App;
